import styled from "styled-components";

const BtnNext = styled.button`
width: 6rem;
height: 2rem;
position:absolute;
left:69vw;
top:93vh;
border-radius: 0.5rem;
border:none;
outline:none;
margin-top:1rem;
background-c
`;

export default BtnNext;
